    "Population, distribution and ecology of Aleutian Canada geese on their migration
    and wintering areas, 1983-84",nt"tracking_summary": {ntt"total": 6,ntt"recent":
    1nt},nt"groups": [],nt"relationships_as_subject": [],nt"revision_timestamp":
    "2016-07-27T23:02:35.257024",nt"name": "population-distribution-and-ecology-of-aleutian-canada-geese-on-their-migration-and-win-19",nt"isopen":
    false,nt"url": null,nt"notes": "The 10th annual wintering ground study
    of the endangered Aleutian Canada goose (Branta canadensis leucopareia) was conducted
    from 22 October 1983 to 11 May 1984. Migration and wintering areas near Crescent
    City, Colusa, El Sobrante, Modesto, and Los Banos, California were monitored. The
    peak fall count was 3,800, which may have been high due to the presence of cackling
    geese (B. c. minima). Approximately 3,150 Aleutians were counted in the spring at
    Crescent City. Three hundred twenty-nine color- marked geese were seen 4,950 times.
    Of the marked geese transplanted to Agattu Island in 1983, 82 percent of the adults
    but only 32 percent of the hatching year young were observed. Sixty-six Aleutians
    were known to have died during the study. Forty-three of these drowned, then were
    washed up on the ocean beach near Crescent City. Of the other 23 birds, 22 were
    shot (7 in closed areas). Eighty-nine new birds were banded in the spring near Crescent
    City. Study methods and results are discussed.",nt"license_title": "License
